import React from "react";

function Card({card, onCardClick}) {
  function handleCardClick() {
    onCardClick(props.card);
  }
  return (
    <div className="element" key={card._id}>
      <button className="element__delete" type="button" />
      <img alt={card.name} className="element__image" src={card.link} onClick={handleCardClick} />
      <div className="element__block">
        <h2 className="element__text">{card.name}</h2>
        <div className="element__heart-area">
          <button className="element__heart" type="button" />
          <p className="element__heart-counter" />
        </div>
      </div>
    </div>
  );
}
export default Card;
